import React from 'react';
import './index.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import web from "./images/brighten.jpg";
import { NavLink } from 'react-router-dom';
import Common from './Common';

const Home=()=>{
    return(
      <>
      <Common 
      name="We are the team of talented Developer making website"
       imgsrc={web}
       visit="/"
       btnName="Get Started" />
 
      </>
    );
};

export default Home;
